const AccountNavBar = () => {
    return (
        <form style={{width: 150, height: 550, border: "1px solid lightslategrey", position: "absolute", top: 55}}>
            <div>
                <button>Особисті дані</button>
            </div>
            <div>
                <button>Поточне замовлення</button>
            </div>
            <div>
                <button>Історія замовлень</button>
            </div>
        </form>
    );
};

export default AccountNavBar;
